// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/security/PullPayment.sol";

contract XKYC is Ownable, PullPayment, ReentrancyGuard{

    //customer details
    struct Customer{
        string cnxid;
        string email;
        string kycDocCID;
        string    verificationStatus; //pending, verified, rejected
        bool isInitialized; 
    }

    struct Details_x_Address {
        Customer details;
        address customerAddress;
    }

    //customer cnxid to address mapping, to enable search by cnxid
    mapping(string => address) internal ID_2_address_map;

    //store customer details in mapping 
    mapping(address => Customer) internal Customers;

    //stores address as a respective index in pendingVerifications
    mapping(address => uint256) internal unverifiedMemberIndex;

    //array of verified addresses
    address[] verifiedMembers;

    //array of pending verifications
    Details_x_Address[] pendingVerifications;

    //array of rejected verifications
    address[] rejectedRequests;

    address payable payee;

    string private completion = "Success";

    //chainlink pricefeed to check BNB price
    AggregatorV3Interface internal priceFeed;

    event detailsSubmitted(address customer, string kycDocCID, string cnxid);

    /**
     * Modifier to limit access to only the admin: 
     * @ONLYOWNER 
     */

    //add means to check that only those registered with CNX can do it

    /**
     * Modifier to prevent reentrancy in functions: nonReentrant
     */
    constructor(){
        //TODO: change the pricefeed address to that of the mainnet when changing to production:
        //BNB MAINNET feed address: 0x0567F2323251f0Aab15c8dFb1967E4e8A7D42aeE
        //current one is mumbai testnet pricefeed address for ETH/USD.
        priceFeed = AggregatorV3Interface(0x0567F2323251f0Aab15c8dFb1967E4e8A7D42aeE);

        payee = payable(0xCaDaa5FB0b4E0EB3c847848ca6F2d136d347D8a7);
        //payee = payable(msg.sender);
    }
    //events:
    //successfully submitted application
    //successfully changed customer verification status to..${status}


    //Customer functions: 
    //will be able to submit request for verification: add customer struct to mapping with address as key
    //will be able to view verification status

    //admin functions:
    //verify address/verification
    //revoke verification
    //view all addresses and their statuses? or search for an address to view its status

    /**
     * Get price from feed in int256, amount charged will be as returned here
     */
    function getBNBprice() public view returns (int256){
        (uint80 roundID,
         int256 answer,
          uint256 startedAt, 
          uint256 timeStamp,
          uint80 answeredInRound) = priceFeed.latestRoundData();

        return answer;
    }

    function submitDetails(Customer memory details) nonReentrant() public payable returns (bool){
        //require(Customers[msg.sender].isInitialized,"Customer already registered");
        //fetch live price from chainlink, calculate using that price
        require(msg.value> 0.0041 ether, "Function called with insufficient funds" );
        details.verificationStatus = 'pending';
        details.isInitialized = true;
        Customers[msg.sender] = details;

        Details_x_Address memory newRequest;

        newRequest.details = details;
        newRequest.customerAddress = msg.sender; 

        pendingVerifications.push(newRequest);

        unverifiedMemberIndex[msg.sender] = pendingVerifications.length - 1;

      //send tx money to payee's wallet

        _asyncTransfer(payee, msg.value);
/* 
      (bool sent, bytes memory data) = owner.call{value:msg.value}("");
        require(sent, " funds not sent"); */

        emit detailsSubmitted(msg.sender, details.kycDocCID, details.cnxid);
        return true;
    }

    function getVerificationStatus( ) public view returns (string memory){
        require(Customers[msg.sender].isInitialized, "Address not registered");
        return Customers[msg.sender].verificationStatus;
    }

    function getUnverifiedMembers() public onlyOwner() view returns (Details_x_Address[] memory ){

        return pendingVerifications;

    }

    //verify single member: address is gotten from the pendingVerifications array in the above function
    function verifyMember(address member, string memory verificationStatus ) onlyOwner() public returns (string memory ){

        require(Customers[member].isInitialized, "Customer not registered");
        Customers[member].verificationStatus = verificationStatus;
        //get corresponding index of unverified member
        uint256 index = unverifiedMemberIndex[member];

        delete pendingVerifications[index];

        return completion;

    } 

    function withdraw () public returns (string memory){ 
        withdrawPayments(payee);

        return completion;
    }

    function viewPendingWithdrawal() public view returns(uint256 ) {
        return payments(payee);
    }

    function changePayee(address _payee) onlyOwner() public returns(string memory){


        payee = payable(_payee);

        return completion;
    }

    //function verifyMembers onlyOwner;
    //function getUnverified members; will return address, and corresponding struct for processing on the admin portal
    //function change verification status for a single member

}
